The ctDNA Working Group shall:
 (i) serve as a forum for discussing the development of the ctDNA Platform and ctDNA Products;
 (ii) serve as a forum for coordinating the Parties' efforts to carry out the R&D Plan;
 (iii) periodically monitor progress of activities under the R&D Plan and discuss any obstacles or delays with regard to achieving thetimelines set forth therein;
 (iv) discuss the overall strategy, including the submission plans, for obtaining and maintaining Regulatory Approval of any of thectDNA Products; and
 (v) such other responsibilities as may be assigned to the ctDNA Working Group in or pursuant to this Agreement or as may bemutually agreed by the Parties in writing.

