The Executive shall report to the Board and shall undertake and perform the following duties and responsibilities: · actively engage with the Board to ensure that the initiatives of the management team are aligned with the strategic direction and objectives for the Company that have been established by the Board;
· provide overall direction for the Company in order for it to implement agreed strategies in order to meet Company goals and objectives;
· provide shareholder and investor communication and manage key investment banking and institutional relationships;
· make decisions in line with organizational goals, leading to desired results, and will be responsible and accountable for results;
· create and sustain the organizational culture and environment needed to achieve objectives and results and recruit and retain a high-performance operating team;
· oversee the implementation and monitoring of internal controls, reporting compliance obligations, sign off on CEO Certificates for the interim and annual financial statements and setting environmental protection policies; and
· such other duties and responsibilities as may be assigned or vested in him by the Board from time to time and which are consistent with the duties and responsibilities of a President and Chief Executive Officer.

In construing this Agreement, the following principles shall be followed:
 9.4.1 no consideration shall be given to the fact or presumption that one Party had a greater or lesser hand in drafting this Agreement;
 9.4.2 examples shall not be construed to limit, expressly or by implication, the matter they illustrate;
 9.4.3 the word "includes" and its syntactical variants mean "includes, but is not limited to" and corresponding syntactical variant expressions; and
 9.4.4 the plural shall be deemed to include the singular and vice versa, as applicable.

The following process shall comply with the requirements set forth in subsection 2(c)(ii) of Appendix A, Attachment 6:
(a) download tools (which are "off the shelf products") used to perform the installation process are not required to be in a secured area;
(b) the recovery CDs are retained in a secured area when not in use;
(c) the installation process is periodically monitored by an IBM employee or IBM contractor employee (who is not an employee of MSL);
(d) the hardfile on which the image is installed is electronically verified and associated to the Product serial number;
(e) MSL electronically tracks the Product serial number, hardfile serial number, and designated model number;
(f) access to the secured area where the recovery CDs are retained when not in use is limited to an IBM employee, IBM contractor employee or MSL;
(g) the MS Certificate of Authenticity (COA) serial number is electronically associated to the Product serial number by the MSL.

WHEREAS, the Parties wish to establish a research program for undertaking specific, collaborative projects after the Effective Date, to further the scientific research and commercial objectives of CERES as well as the scientific research objectives of IGER;
WHEREAS, the research programs contemplated by this Agreement and its schedules are consistent with and in furtherance of IGER research programs;
WHEREAS, CERES and IGER recognize that rights to intellectual property conceived or reduced to practice in the performance of the Parties' collaboration can be a strong incentive for CERES to risk money and other resources needed to develop proprietary products for wide commercialization;
NOW THEREFORE, in consideration of the premises and of the mutual covenants and agreements contained herein and of other good and valuable consideration, the Parties have agreed and do hereby agree as follows:
1.1 CERES and IGER anticipate that from time to time they may undertake and conduct certain joint and collaborative research projects (individually a "RESEARCH PROJECT" and collectively "RESEARCH PROJECTS").

Proprietary Information shall not include information that the receiving party can show through written documentation:
(a) at the time of disclosure, is publicly known;
(b) after the time of disclosure, becomes part of the public domain, except by breach of an agreement between the disclosing party or any Affiliate thereof and the receiving party or any Affiliate thereof;
(c) is or was in the possession of the receiving party or any Affiliate thereof at the time of disclosure by the disclosing party and was not acquired directly or indirectly from the disclosing party or any Affiliate thereof or from any other party under an agreement of confidentiality to the disclosing party or any Affiliate thereof; and
(d) is or was developed by the receiving party or its Affiliates without use of or reference to the other party's Proprietary Information.

